import React from 'react';
import Head from 'next/head';

export default class Index extends React.Component {
    render () {
        return (
            <div>
                <Head>
                    <title>Reece Russell / Software Developer</title>
                </Head>

                <section>
                    <style jsx>
                        {`
                        
                        section {
                            backgroun-color: #eeeeee;
                        }

                        `}
                    </style>

                    <h1>Reece Russell</h1>
                    <p>Software Developer</p>
                </section>
            </div>
        )
    }
}
